import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import './RemoveBackground.css';
import mangoLogo from '../../assets/Logo_white.png';
import userProfileImg from '../../assets/profile.jpg';

const RemoveBackground = () => {
    const navigate = useNavigate();
    const [image, setImage] = useState(null);
    const [processedImage, setProcessedImage] = useState(null);

    const handleAboutUs = () => navigate('/aboutuspage');
    const handleContactUs = () => navigate('/contactuspage');
    const handleUserProfile = () => navigate('/userprofilepage');
    const handleDashboard = () => navigate('/dashboardpage');
    const handleFeatureAnalysis = () => navigate('/featureanalysis');
    const handleResize = () => navigate('/resize');

    const handleImageUpload = (e) => {
        const file = e.target.files[0];
        if (file) {
            const reader = new FileReader();
            reader.onload = () => setImage(reader.result);
            reader.readAsDataURL(file);
        }
    };

    const handleRemoveBackground = async () => {
        if (!image) return;

        // Example using remove.bg API
        try {
            const response = await fetch('https://api.remove.bg/v1.0/removebg', {
                method: 'POST',
                headers: {
                    'X-Api-Key': 'your-api-key-here',
                },
                body: JSON.stringify({
                    image_file_b64: image.split(',')[1],
                }),
            });
            const blob = await response.blob();
            const url = URL.createObjectURL(blob);
            setProcessedImage(url);
        } catch (error) {
            console.error('Error removing background:', error);
        }
    };

    const handleReset = () => {
        setImage(null);
        setProcessedImage(null);
    };

    return (
        <div className="remove-background-page">
            <nav className="navbar">
                <div className="navbar-brand">
                    <img src={mangoLogo} alt="Mango Logo" className="mango-logo" />
                </div>
                <div className="navbar-links">
                    <button className="navbar-link" onClick={handleDashboard}>Dashboard</button>
                    <button className="navbar-link">Remove Background</button>
                    <button className="navbar-link" onClick={handleFeatureAnalysis}>Feature Analysis</button>
                    <button className="navbar-link" onClick={handleResize}>Resize</button>
                    <button className="navbar-link" onClick={handleAboutUs}>About Us</button>
                    <button className="navbar-link" onClick={handleContactUs}>Contact Us</button>
                </div>
                <div className="navbar-profile" onClick={handleUserProfile}>
                    <img src={userProfileImg} alt="User Profile" className="user-profile" />
                </div>
            </nav>

            <div className="remove-background-content">
                <h1 className="remove-background-title">Remove Background</h1>
                <p className="description">Remove backgrounds from your images in seconds!</p>
                <div className="image-upload-container">
                    <div className="image-upload">
                        <label htmlFor="imageInput" className="upload-label">Upload Image 📁</label>
                        <input
                            type="file"
                            id="imageInput"
                            accept="image/*"
                            onChange={handleImageUpload}
                            hidden
                        />
                    </div>

                    {image && (
                        <div className="image-preview">
                            <img src={image} alt="Uploaded" className="uploaded-image" />
                        </div>
                    )}

                    {processedImage && (
                        <div className="processed-image">
                            <img src={processedImage} alt="Processed" className="processed-image-preview" />
                        </div>
                    )}
                </div>

                <div className="action-buttons">
                    <button className="bt backto-bt" onClick={handleReset}>
                        Reset
                    </button>
                    <button
                        className="bt upload-removebackground-bt"
                        onClick={handleRemoveBackground}
                        disabled={!image}
                    >
                        Remove Background
                    </button>
                </div>
            </div>

            <footer className="footer-removebackground">
                <div className="footer-address">
                    <p>Mae Fah Luang University 333 Moo 1, Thasud, Muang, Chiang Rai 57100</p>
                </div>
            </footer>
        </div>
    );
};

export default RemoveBackground;
